// --- Function to copy the array(s) into the provided string buffer.
// --- Buffer size is not checked, as MakeCARR makes sure it's sufficient.
// ---------------------------------------------------------------------
void ReadJMEBIData(char *Buffer)
{
    memcpy(Buffer, &JMEBIL0[1], JMEBIL0[0] << 2);
    Buffer += (JMEBIL0[0] << 2);

    memcpy(Buffer, &JMEBIL1[1], JMEBIL1[0] << 2);
    Buffer += (JMEBIL1[0] << 2);

    memcpy(Buffer, &JMEBIL2[1], JMEBIL2[0] << 2);
    Buffer += (JMEBIL2[0] << 2);

    memcpy(Buffer, &JMEBIL3[1], JMEBIL3[0] << 2);
    Buffer += (JMEBIL3[0] << 2);

    memcpy(Buffer, &JMEBIL4[1], JMEBIL4[0] << 2);
    Buffer += (JMEBIL4[0] << 2);

    memcpy(Buffer, &JMEBIL5[1], JMEBIL5[0] << 2);
}

// --- Saved full qualified output path and filename, so we've no troubles
// --- when cleaning up, even if the current working folder was changed
// --- during program runtime.
// ---------------------------------------------------------------------
char JMEBIName[8192]; // it's a safe size for any current OS

// --- Cleanup function to delete the written file, called by the atexit()
// --- handler at program termination time, if requested by user.
// ---------------------------------------------------------------------
void KillJMEBIData(void)
{
    remove(JMEBIName);
}

// --- Function to write the array(s) back into a file, will return the
// --- full qualified output path and filename on success, otherwise an
// --- empty string is returned (access/write errors, file truncated).
// ---------------------------------------------------------------------
const char *WriteJMEBIData(const char *FileName, int16_t AutoClean)
{
    FILE   *han = NULL; // file handle
    int32_t num = NULL; // written elements

    #ifdef QB64_WINDOWS
    if (!_fullpath(JMEBIName, FileName, 8192)) return "";
    #else
    if (!realpath(FileName, JMEBIName)) return "";
    #endif

    if (!(han = fopen(JMEBIName, "wb"))) return "";
    if (AutoClean) atexit(KillJMEBIData);

    num = fwrite(&JMEBIL0[1], 4, JMEBIL0[0], han);
    if (num != JMEBIL0[0]) {fclose(han); return "";}

    num = fwrite(&JMEBIL1[1], 4, JMEBIL1[0], han);
    if (num != JMEBIL1[0]) {fclose(han); return "";}

    num = fwrite(&JMEBIL2[1], 4, JMEBIL2[0], han);
    if (num != JMEBIL2[0]) {fclose(han); return "";}

    num = fwrite(&JMEBIL3[1], 4, JMEBIL3[0], han);
    if (num != JMEBIL3[0]) {fclose(han); return "";}

    num = fwrite(&JMEBIL4[1], 4, JMEBIL4[0], han);
    if (num != JMEBIL4[0]) {fclose(han); return "";}

    num = fwrite(&JMEBIL5[1], 4, JMEBIL5[0], han);
    if (num != JMEBIL5[0]) {fclose(han); return "";}

    fclose(han);
    return JMEBIName;
}

